import NavBar from "./components/NavBar";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  BrowserRouter,
} from "react-router-dom";

function App() {
  return (
    <div>
      <BrowserRouter>
        <NavBar />
        <Routes></Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
